from typing import List


class Solution:
    def letterCombinations(self, digits: str) -> List[str]:
        if not digits:
            return []
        mapping = {
            "2": "abc",
            "3": "def",
            "4": "ghi",
            "5": "jkl",
            "6": "mno",
            "7": "pqrs",
            "8": "tuv",
            "9": "wxyz",
        }
        res = []
        self.dfs(mapping, digits, 0, "", res)
        return res

    def dfs(self, mapping, digits, index, path, res):
        if index == len(digits):
            res.append(path)
            return
        for c in mapping[digits[index]]:
            self.dfs(mapping, digits, index + 1, path + c, res)
